import React from 'react';
import './Form.css';

export default function Form() {
  return (
    <div id="form-container">
      <form id="form" method="post">
        <input type="url"
          id="input"
          placeholder="Paste your URL here..."
          autocomplete="on"
          required
        />
        <button type="submit">Chonk!</button>
      </form>

    </div>
  );
}
